package traing.prob451;

import java.util.*;

/**
 * Sort Characters By Frequency
 * Link: https://leetcode.com/problems/sort-characters-by-frequency/description/
 *
 * @author zhaokai
 * @version 1.0
 * @since 1.0 - 8/17/17
 */
public class Solution {
    public String frequencySort(String s) {
        Map<Character, Integer> charCount = new HashMap<>();
        int maxFrequency = 0;
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            charCount.put(c, charCount.getOrDefault(c, 0) + 1);
            maxFrequency = Math.max(maxFrequency, charCount.get(c));
        }
        List<Character>[] buckets = new List[maxFrequency + 1];
        for (Map.Entry<Character, Integer> entry : charCount.entrySet()) {
            if (buckets[entry.getValue()] == null) {
                buckets[entry.getValue()] = new ArrayList<>();
            }
            buckets[entry.getValue()].add(entry.getKey());
        }
        StringBuilder sb = new StringBuilder();
        for (int i = buckets.length - 1; i >= 0; i--) {
            List<Character> cList = buckets[i];
            if (cList != null) {
                for (Character c : cList) {
                    for (int j = 0; j < i; j++) sb.append(c);
                }
            }
        }
        return sb.toString();
    }

    public static void main(String[] args) {
        final Solution s = new Solution();
//        System.out.println(s.frequencySort(""));
        System.out.println(s.frequencySort("abca"));
    }
}
